import React from 'react'
import {useState} from 'react';

function Form() {
    const [name, setName] = useState("");
    var userName;
    return (
        <div>
            <form>
                <label>Enter your name: </label>
                <input type="text" value={name} onChange={ (e) => {
                        setName(e.target.value)
                    }
                }/>
            </form><br/>
            {/* <h1>Your name is {name}, right?</h1> */}
            <input type="button" id="buttonName" value="Check name" onClick={butonName}></input>
        </div>
    )
}

function butonName(){
    var butonName = document.querySelector('#buttonName');
    butonName.addEventListener('click', () => {
        var text = document.createElement('h2');
        text.innerText = `Your name is ${userName}, right?`;
    });
}

export default Form;
